import React from 'react'

const BlackKeys = (props) => {

    const Csharp = () => {
        props.black.triggerAttackRelease('C#2','4n');
    } 
    const Dsharp = () => {
        props.black.triggerAttackRelease('D#2','4n');
    } 
    const Fsharp = () => {
        props.black.triggerAttackRelease('F#2','4n');
    } 

    return(
        <div id='black-keys'>
            <button id='black-keys cs' onClick={Csharp}>C#</button>
            <button id='black-keys ds' onClick={Dsharp}>D#</button>
            <button id='black-keys fs' onClick={Fsharp}>F#</button>
        </div>
    );
}

export default BlackKeys;
